class CoordinatesForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = { value: '' };

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({ value: event.target.value });
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.value);
    event.preventDefault();
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          x1:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          y1:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          x2:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          y2:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label><br></br>
        <label>
          x3:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          y3:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          x4:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label>
        <label>
          y4:
          <input type="number" value={this.state.value} onChange={this.handleChange} min="1" max="1000" />
        </label><br></br>

        <input type="submit" value="Submit" />
        <style jsx>{`
        label {
          text-decoration: none;
          color: blue;
          font-size: 16px;
          margin: 10px;
        },

        input[type=submit] {
          background-color: #4CAF50;
          border: none;
          color: white;
          padding: 16px 32px;
          text-decoration: none;
          margin: 4px 2px;
          cursor: pointer;
        }
      `}</style>
      </form>

    );
  }
}

export default CoordinatesForm;
